import {
  Form,
  Select,
  InputNumber,
  DatePicker,
  Switch,
  Slider,
  Button,
  Input,
} from "antd";
import Link from "next/link";
import HeaderCovid from "./components/component.headercovid";
import ShowProfile from './components/component.showprofile'

const FormItem = Form.Item;
function CovidPage4() {
  return (
    <div style={{ marginTop: 0 }}>
      <FormItem>
        <div className="nu-font-covid">
          <div
            style={{
              display: "flex",
              flexDirection: "column",
              height: "100vh",
              width: "100vw",
            }}
          >
            <div
              style={{
                flexBasis: "auto",
              }}
            >
              <HeaderCovid />
            </div>
            <div
              style={{
                display: "flex",
                flexBasis: "auto",
                height: "100%",
                justifyContent: "center",
                alignItems: "center",
                width:"100%",
                background:"orange"
              }}
            >
              <ShowProfile />
            </div>
            <div
              style={{
                flexBasis: "auto",
                background: "red",
                display: "flex",
                justifyContent: "flex-end",
              }}
            >
                <Button>เริ่มการประเมิน</Button>
            </div>
            <div
              style={{
                flexBasis: "auto",
                background: "blue",
                display: "flex",
                justifyContent: "center",
              }}
            >
              <h5>
                Copyright © All rights reserved. 2020 มหาวิทยาลัยนเรศวร Naresuan
                UniversityUniversity
              </h5>
            </div>
          </div>
        </div>
      </FormItem>
    </div>
  );
}

export default CovidPage4;
